import './App.css';
import Navbar from './Navbar';
import Choice from './Choice'
import Result from './Result'
import Home from './Home'
import { BrowserRouter as Switch, Route, BrowserRouter, HashRouter } from 'react-router-dom';
function App() {
  const scores=0;
  return (
    <div className="App"> 
    <Navbar/>
    <div className="content">
    <BrowserRouter>
    <HashRouter basename="/">

        <Switch>
          <Route path="/" element={<Choice scores={scores}/>}></Route>
          <Route path="/result" element={<Result />}></Route>
          <Route path="/homeoflove" element={<Home />}></Route>
        </Switch>

    </HashRouter>
    </BrowserRouter>
    </div>
    </div>
  );
}

export default App;
